import React from 'react';
import Slider from '../Slider';
import Campos from './Campos';

function CadastroFornecedor() {
return (
// Backgroud do sistema
<div className="bg-gradient-to-r from-black to-green-500 w-screen h-screen">
    <Slider/>
    {/* Area de cadastro */}
    <div className='flex justify-center'>
        <div className='bg-lime-800 w-11/12 h-[500px] mt-8 rounded-lg border-2 border-black'>
            {/* Campos de cadastro */}
            <div className='text-center mt-8'>
                <div className='font-bold text-4xl text-white   '>
                    Cadastro de Fornecedor
                </div>
            </div>
            <div className='flex flex-col gap-y-8 p-16'>
                <Campos/>
            </div>
            {/* Bot√µes */}
            <div className='flex items-end justify-evenly'>
                <div className='border-2 border-black bg-lime-600 rounded-2xl w-60 flex justify-center'>
                    <button className='text-white text-2xl p-0.5'>Cadastrar</button>
                </div>
                <div className='border-2 border-black bg-red-600 rounded-2xl w-60 flex justify-center'>
                    <button className='text-white text-2xl p-0.5'>Cancelar</button>
                </div>
            </div>
        </div>
    </div>
</div>
);
}


export default CadastroFornecedor;
